import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import ParticipantListTable from './ParticipantListTable';

export default class Participant extends Component {

  constructor(props) {
    super(props);
    this.state = {
      materialId: '',
      participantList: [],
    };
  }
  componentDidMount() {
    this.getParticipantByMaterialId(this.props.match.params.id);
    this.props.setHeader("MBooklet");
  }

  getParticipantByMaterialId = (id) => {
    const url = `${this.props.url_Booklet.GET_PARTICIPANT_BY_MATERIAL_ID}?id=${id}`;
    this.props.ajaxUtil.sendRequest(url, {}, participantList => {
      if (participantList.hasOwnProperty('data')) {
        if (participantList.data != null && participantList.data.length > 0) {
          this.setState({ participantList: participantList.data })
        }
      }
    }, this.props.loadingFunction,
      { method: 'GET', isShowSuccess: false });
  }
  render() {
    const { participantList } = this.state
    return (
      <div className="col-md-12">
        <div className="mainbg cus-pills h-100">
          <ul className="nav nav-pills d-flex justify-content-between">
            <li className="nav-item">
              <a className="nav-link active" data-toggle="pill" href="#Quiz">Participants</a>
            </li>
            <Link to="/Dashboard/MBookLet/">
              <img src="/dms/images/close.svg" className="nav-close" />
            </Link>
          </ul>
          <div className="tab-content pzero  d-material-tabcontent">
            <div className="tab-pane active" id="Quiz">
              <div className="Modules-txt h-100 ">
                <div className="col-md-12">
                  {/* commented for new flow */}
                  {/* <h4 className="title"><span>Module:</span> {moduleName}</h4> */}
                </div>
                <div className="d-flex mb-10 modulesheader mt-30">
                  <div className="col-md-6 d-flex align-items-center">
                    <h4>All Entities | 01 </h4>
                  </div>
                  <div className="col-md-6 d-flex align-items-center justify-content-end">
                    <div className="searchbox ">
                      <input type="search" placeholder="What are you looking for ?" />
                      <button className="btn"><i className="fa fa-search" aria-hidden="true" /></button>
                    </div>
                    <div className="filter">
                      <img src="/dms/images/filter.svg" alt="filter" />
                    </div>
                  </div>
                </div>
                <ParticipantListTable participantList={participantList} />

              </div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
